# OEIS sequence: A022544

from math import isqrt
def aupto(lim):
  squares = [k*k for k in range(isqrt(lim)+2) if k*k <= lim]
  sum2sqs = set(a+b for i, a in enumerate(squares) for b in squares[i:])
  return sorted(set(range(lim+1)) - sum2sqs)
print(aupto(120)) # _Michael S. Branicky_, Mar 06 2021

